import "bootstrap/dist/css/bootstrap.min.css";
import NavbarComponent from "./navbarComponent";
import HomeComponent from "./homeComponent";
import LoginComponent from "./loginComponent";
import ScheduleComponenet from "./"
import { BrowserRouter as Router, Route, Switch } from "react-router-dom";
import "./navbar.css";


function App() {
  return (
    <div className="App">
      <Router>
        <header>
          <NavbarComponent />
        </header>
        <Switch>
          <Route exact path="/">
            <HomeComponent />
          </Route>
        </Switch>

        <Switch>
          <Route exact path="/">
            <ScheduleComponenet />
          </Route>
        </Switch>

        <Switch>
          <Route exact path="/">
            <LearningComponenet />
          </Route>
        </Switch>
      </Router>
    </div>
  );
}

export default App;
